BEGIN TRANSACTION;
CREATE TABLE IF NOT EXISTS `regions_eng` (
	`region_code`	INTEGER NOT NULL,
	`region_name`	VARCHAR ( 64 ),
	`explain`	VARCHAR ( 64 ),
	PRIMARY KEY(`region_code`)
);
CREATE TABLE IF NOT EXISTS `regions` (
	`region_code`	INTEGER NOT NULL,
	`region_name`	VARCHAR ( 64 ),
	`explain`	VARCHAR ( 64 ),
	PRIMARY KEY(`region_code`)
);
CREATE TABLE IF NOT EXISTS `questions_eng` (
	`question_code`	INTEGER NOT NULL,
	`region_code`	INTEGER,
	`train_code`	VARCHAR ( 64 ),
	`question_name`	VARCHAR ( 64 ),
	`line`	VARCHAR ( 64 ),
	`foreign_code`	VARCHAR ( 64 ),
	`x_coordinate`	FLOAT,
	`y_coordinate`	FLOAT,
	`question`	VARCHAR ( 64 ),
	`answer`	VARCHAR ( 64 ),
	`hint`	VARCHAR ( 64 ),
	`content_type`	VARCHAR ( 64 ),
	PRIMARY KEY(`question_code`),
	FOREIGN KEY(`region_code`) REFERENCES `regions_eng`(`region_code`)
);
CREATE TABLE IF NOT EXISTS `questions` (
	`question_code`	INTEGER NOT NULL,
	`region_code`	INTEGER,
	`train_code`	VARCHAR ( 64 ),
	`question_name`	VARCHAR ( 64 ),
	`line`	VARCHAR ( 64 ),
	`foreign_code`	VARCHAR ( 64 ),
	`x_coordinate`	FLOAT,
	`y_coordinate`	FLOAT,
	`question`	VARCHAR ( 64 ),
	`answer`	VARCHAR ( 64 ),
	`hint`	VARCHAR ( 64 ),
	`content_type`	VARCHAR ( 64 ),
	FOREIGN KEY(`region_code`) REFERENCES `regions`(`region_code`),
	PRIMARY KEY(`question_code`)
);
CREATE TABLE IF NOT EXISTS `grades` (
	`id`	INTEGER NOT NULL,
	`correct`	INTEGER,
	`grade`	VARCHAR ( 64 ),
	`hint`	INTEGER,
	PRIMARY KEY(`id`)
);
COMMIT;
